import React, {Component} from "react";
import './home.css'


class Homepage extends Component 
{

    
    render() {
        return (<div className="homepage">
            <h2>
                Turn your living room into
                <div className="mask">
                    <span data-show>a theater.</span>
                    <span>a gym.</span>
                    <span>a concert hall.</span>
                    <span>an arcade.</span>
                </div>
            </h2>
        </div>)
    }
}



export default Homepage;
